$(()=>{$.ajax({url:"http://127.0.0.1:3000/api/getcoupon",dataType:"json",success:o=>{let n=o.result,t="";n.forEach(o=>{t+=`\n                <li style="width: 118.333px;">\n                <a href="./couponproduct.html?couponid=${o.couponId}&amp;name=${o.couponTitle}"\n                    class="">\n                    <img src="${o.couponImg}" alt=""> \n                    <br>${o.couponTitle}\n                </a>\n                </li>\n                `}),$(".coupon-title ul").html(t)}})});